            big_object2 = p5.loadImage(path + "objects/big_object2.png");
            //loading base tiles
            floor = p5.loadImage(path + "tile.png");
            wall = p5.loadImage(path + "tileURDL.png");
            door = p5.loadImage(path + "door.png");
            background = p5.loadImage(path + "background.png");
